import React from 'react';
import ReactDOM from 'react-dom';
import './chatbox.css';

const ChatPop = (props) => {

    let d = new Date();

    return(
        <div class = {`containerchat ${props.dark}`}>
            <img src={props.imgsrc} alt="Avatar" className="right"/>
            <p><h3>{props.text}</h3></p>
            <span class="time-right">{`${d.getHours()}:${d.getMinutes()}:${d.getSeconds()}`}</span>
        </div>
    );
};

export default ChatPop;
